import React from "react";
//import list icon
import listSvg from "./assets/list.svg";

function App() {
  return (
    <div className="todo">
      {/* sidebar block */}
      <div className="todo_sidebar">
        <ul className="todo_list">
          <li>
            <i>
              <img src={listSvg} alt="list icon"></img>
            </i>
            <span>All tasks</span>
          </li>
        </ul>
      </div>
      {/* tasks block */}
      <div className="todo_tasks">Tasks</div>
    </div>
  );
}

export default App;
